import model from "../model/model";

class StudentsListPresenter {
    onCreate(){
        model.addQuestion("Glass", "Is it transparent?");
    }

    onChange(){
        model.change
    }
}
const studentsListPresenter = new StudentsListPresenter();
export default studentsListPresenter;
